import React,{Component} from 'react'
import {Search_img,Search_input,Search_warpper} from './style'
import logopic from '../statics/jingdong.gif'


class Search extends Component{

  render(){
    return(
      <Search_warpper>
      <Search_img>
        <img src={logopic}/>
      </Search_img>
      <Search_input>
        <input ></input>
        <div className="sw_input">无线路由</div>
        <button className="iconfont iconf">&#xe66d;</button>
      </Search_input>
      </Search_warpper>
    )
  }
}

export default Search;
